import React from 'react'
import { params } from './params';
import { useState,useEffect } from 'react';


export default function FullParameterList() {
    onst[products, setProducts] = useState([]);

    useEffect(() => {
        params.getProductsMini().then(data => setProducts(data));
    }, []);


    return (
        <div>FullParameterList</div>
    )
}
